Hi, this mac had been repaired and come back, the first time had oxidation in the pads u8160, u8005, and u5110, I cleaned with the mesh.
Now the mac just lights the orange led of MagSafe.

Voltage: PPbus_g3h 8.6V; pp3v42_g3h 3.42V; ALL_SYS 0V, pulsing up to 1.2V; CPU VCore 0V, pulsing 0.45V; PPVRTC 3.35V; PM_PCH_SYS_PWROK 0v, pulsing 214mV; PLT_RESET_l 0V, pulsing; PM_SLP_S4_L 0v, pulsing 0.85V;
